import React from 'react';
import { motion } from 'framer-motion';
import AdmissionProcess from '../components/services/AdmissionProcess';
import { FaFileAlt, FaCheckCircle, FaCalendarCheck } from 'react-icons/fa';

const AdmissionProcessPage = () => {
  const pageInfo = {
    title: 'Our Admission Process',
    description: 'At STEPS Education Limited, we provide a streamlined 6-step admission process to ensure your educational journey is smooth and successful. From document assessment to enrollment, we offer comprehensive support at every stage.'
  };

  const additionalInfo = [
    {
      title: 'Required Documents',
      description: 'Passport, academic transcripts/certificates, English language proficiency test results, personal statement/SOP, references/recommendation letters, and CV',
      icon: <FaFileAlt className="text-blue-600 text-xl" />
    },
    {
      title: 'Fast Turnaround Times',
      description: 'Document assessment within 3 days, university application processing within 2 weeks, CAS issuance typically within 2-4 weeks after university acceptance',
      icon: <FaCheckCircle className="text-blue-600 text-xl" />
    },
    {
      title: 'Application Deadlines',
      description: 'For September intake: June 30 | For January intake: November 15 | For May intake: March 30 (deadlines may vary by university)',
      icon: <FaCalendarCheck className="text-blue-600 text-xl" />
    }
  ];

  return (
    <div className="pt-16">
      {/* Hero Section */}
      <motion.section 
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 0.6 }}
        className="relative py-20 bg-blue-900 text-white"
      >
        <div className="container mx-auto px-4">
          <h1 className="text-4xl md:text-5xl font-bold mb-6">
            {pageInfo.title}
          </h1>
          <p className="text-xl max-w-3xl">
            {pageInfo.description}
          </p>
        </div>
      </motion.section>

      {/* Main Content */}
      <AdmissionProcess />

      {/* Additional Information */}
      <section className="py-16 bg-gray-50">
        <div className="container mx-auto px-4">
          <motion.h2 
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            viewport={{ once: true }}
            className="text-3xl font-bold text-center text-blue-600 mb-12"
          >
            Important Information
          </motion.h2>
          
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {additionalInfo.map((info, index) => (
              <motion.div 
                key={index}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.1 * index, duration: 0.5 }}
                viewport={{ once: true }}
                className="bg-white p-6 rounded-lg shadow-md"
              >
                <div className="flex items-start">
                  <div className="mr-4 mt-1">{info.icon}</div>
                  <div>
                    <h3 className="text-xl font-semibold text-gray-800 mb-3">{info.title}</h3>
                    <p className="text-gray-600">{info.description}</p>
                  </div>
                </div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="py-16 bg-blue-600 text-white">
        <div className="container mx-auto px-4 text-center">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            viewport={{ once: true }}
          >
            <h2 className="text-3xl font-bold mb-4">Ready to Start Your Educational Journey?</h2>
            <p className="text-xl mb-8 max-w-3xl mx-auto">
              Contact us today to begin your application process. Our team of experts is ready to guide you through every step.
            </p>
            <div className="flex flex-col sm:flex-row justify-center gap-4">
              <a
                href="mailto:info@stepseeducation.co.uk"
                className="px-8 py-3 bg-white text-blue-600 font-semibold rounded-md hover:bg-gray-100 transition-colors"
              >
                Email: info@stepseeducation.co.uk
              </a>
              <a
                href="tel:+4447563228537"
                className="px-8 py-3 bg-transparent border-2 border-white text-white font-semibold rounded-md hover:bg-white/10 transition-colors"
              >
                Call: +44-475-63228537
              </a>
            </div>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default AdmissionProcessPage;
